import { NavigationContainer } from "@react-navigation/native";
import React from "react";
import TabNavigation from "./Navigation";

const Navigator = () => {
  return (
    <NavigationContainer>
      <TabNavigation />
    </NavigationContainer>
  );
};

export default Navigator;
